      { childId: 20, isChecked: false },
      { childId: 21, isChecked: false },
    ],
  },
  {
    name: "Section 2",
    isParentChecked: false,
    id: 2,
    children: [
      { childId: 2, isChecked: false },
      { childId: 2, isChecked: false },
      { childId: 2, isChecked: false },
    ],
  },
  {
    name: "Section 3",
    isParentChecked: false,
    childId: 3,
    children: [
      { childId: 3, isChecked: false },
      { childId: 3, isChecked: false },
      { childId: 3, isChecked: false },
    ],
  },
];

export const Strings = {
  "Class-9": "Class 9",
};
